import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          name: 'Dracula',
          id: 'mon1',
        },
        {
          name: 'Frankestein',
          id: 'mon2',
        },
        {
          name: 'Asura',
          id: 'mon3',
        },
        {
          name: 'Nun',
          id: 'mon4',
        },
      ],
    };
  }

  handleChange = () => {};

  render() {
    return (
      <div className='App'>
        {this.state.monsters.map((monster) => {
          return true;
        })}
      </div>
    );
  }
}

export default App;
